import {USER_ACTION} from '../constants';
import {createAction} from "@reduxjs/toolkit";

export const addTaskAction = createAction(USER_ACTION.LOGIN);
export const editTaskAction = createAction(USER_ACTION.LOGOUT);
export const deleteTaskAction = createAction(USER_ACTION.REGISTER);
